package dol;

public class asignaturas {
		private String matematica;
		private String ingles;
		private String español;
		private String computacion;
		public asignaturas() {
			super();
			// TODO Auto-generated constructor stub
		}
		public asignaturas(String matematica, String ingles, String español, String computacion) {
			super();
			this.matematica = matematica;
			this.ingles = ingles;
			this.español = español;
			this.computacion = computacion;
		}
		public String getMatematica() {
			return matematica;
		}
		public void setMatematica(String matematica) {
			this.matematica = matematica;
		}
		public String getIngles() {
			return ingles;
		}
		public void setIngles(String ingles) {
			this.ingles = ingles;
		}
		public String getEspañol() {
			return español;
		}
		public void setEspañol(String español) {
			this.español = español;
		}
		public String getComputacion() {
			return computacion;
		}
		public void setComputacion(String computacion) {
			this.computacion = computacion;
		}
	
		
		
		
	

	
	
}
